:root {
    --accent-color: #ffffff;
    --div-grey: rgb(0 0 0 / 0%);
    --div-black: rgb(59 58 58 / 0%);
}

/* fonts */
@font-face {
    font-family: gamefont;
    src: url(https://fonts.gstatic.com/s/montserrat/v15/JTURjIg1_i6t8kCHKm45_dJE3gnD_g.woff2);
}

/* menu css */
/* bottom */
.button {
    background-color: transparent !important;
}

#subLogoButtons {
    bottom: 90px;
}

.button,
.button:hover {
    border: hidden ! important;
}

/* top left top right */
#mLevelCont,
.headerBarLeft,
.headerBarRight {
    background-color: transparent;
}

#menuAccountUsername {
    margin-left: 10px;
    margin-top: 9px;
}

.progressBar {
    background-color: rgba(0, 0, 0, 0.15);
}

.progressBarInner {
    background-image: linear-gradient(to right, white, lightgrey);
    transition: width 1s ease-in-out;
    border-radius: 0px
}

/* left */
.material-icons-outlined,
span.material-symbols-outlined.menBtnIcn {
    color: #fff !important
}

#menuItemContainer {
    background: transparent
}

.menuItem .menuItemTitle {
    font-size: 18px !important;
}

/* hud class popup */
#menuClassContainer {
    top: unset;
}

