.endAHolder,
#streamContainer,
#topRightAdHolder,
#merchImg,
#ot-sdk-btn-floating.ot-floating-button,
#seasonLabel,
#termsInfo,
#streamContainer,
#mapInfoHld,
#mainLogo,
#curGameInfo,
