#menuLevelIcon,
#menuMiniProfilePic,
.menuClassPlayerVirus,
#menuClassSubtext,
#menuClassName,
#menuClassIcn,
#customizeButton .material-icons,
#policeButton,
.krSocial,
.imageButton,
#editorBtnM {
    display: none !important;
}

/* health bar */
#bottomLeftHealthBar {
    width: 200px;
    position: fixed;
    left: calc(50% - 110px);
    bottom: 25px;
}

.nHealthBarSeg {
    display: flex;
    height: 21px;
    width: -webkit-fill-available;
    margin: 0 -3.88px;
    background: transparent
}

.nHpBSeg {
    border-radius: 1;
}

/* ammo - THANKS JITCHU */
#ammoHolder {
    transform: unset;
}

#ammoVal {
    font-size: 40px;
    display: inline-block;
    position: fixed;
    left: calc(50% + 110px);
    bottom: 22px;
}

/* timer */
#timerHolder {
    position: fixed;
    top: 1%;
    left: 1%;
}

#timerVal {
    font-size: 30px;
    padding-left: 0;
    text-shadow: 2px 2px 3px rgba(30, 30, 30, .5);
}

/* counters */
#killsVal,
#deathsVal,
#streakVal,
#myScoreVal,
#kdVal {
    color: white;
    font-size: 30px;
    text-shadow: 2px 2px 3px rgba(30, 30, 30, .5);
}

#killsIcon,
#deathsIcon,
#streakIcon,
#kdIcon {
    width: 30px;
    height: 30px;
    image-rendering: pixelated;
    image-rendering: -moz-crisp-edges;
    image-rendering: antialiased;
}

/* fps and ping */
#fpsDisplay,
#fpsDisplay>span {
    padding-left: 3px;
    padding-top: 50px
}


#ingameFPS,
#menuFPSDisplay,
#menuPingText,
#menuPingDisplay .material-icons,
#pingDisplay,
#fpsDisplay,
#ingressDisplay,
#egressDisplay,
#tickDisplay,
#pingText,
#ingressPacketCount,
#ingressDataSize,
#egressPacketCount,
#egressDataSize,
#tickPacketCount {
    color: rgb(255, 255, 255) !important;
    text-shadow: 2px 2px 3px rgba(30, 30, 30, .5);
}

/* chat */
#chatInput {
    font-size: 18px;
    background-color: rgba(0, 0, 0, 0);
    border: 0px solid rgba(0, 0, 0, 0);
    border-radius: 0px
}

#chatSwitch {
    margin-bottom: -3px;
}

#chatList {
    background-color: rgba(0, 0, 0, .1);
}

.chatItem {
    font-size: 18px;
    padding-right: 5px;
    max-width: 265px;
}

.chatItem span[style="color:#fc03ec"] {
    color: hotpink !important;
}

#pollfishIndicator {
    display: none !important;
}

#genericPop,
#bundlePop {
    display: none !important;
}

